import React from 'react';
import {Switch, Route} from 'react-router-dom';
import {Card, CardTitle, CardSubTitle, CardButtons, Members } from '../UI/Card/Card';

const Projects = () => {

  return (
    <Switch>
      <Route path="/"><All/></Route>
      <Route path="/my">my</Route>
      <Route path="/notmy">not my</Route>
    </Switch>
  );
}

const All = (props) => {
  return (
    <Card></Card>
  );
}

export default Projects;
